import React from 'react'
import Tree from 'react-tree-graph';

const VisualSide = ({data}) => (

	<div id="treeWrapper" style={{width: '50em', height: '20em'}}>

	<Tree
		data={data}
		height={400}
		width={400}
		svgProps={{
			transform: "rotate(90)"
		}}
		textProps={{
			transform: "rotate(270)"
		}}
		animated={true}
	/>

	</div>

)

export default VisualSide
